    get currentBrand() {
        return this.static.brands.find( brand => ( brand.name === this.fields.brand ) )
    },
    get currentCertification() {
        return this.static.certifications.find( certification => ( certification.name === this.fields.certification ) )
    },
    notify(message, duration = 4000) {
        if (this.notifications.length)
            clearTimeout(this.notifications.at(-1).id);
        this.notifications.push({
            message, 
            duration, 
            id: setTimeout(() => {
                this.notifications = []
            }, duration)
        })
    },
    copySignature() {
        let content = document.querySelector("#rendered-signature").innerHTML;
            content = new Blob( [content], { type: "text/html" } );
            content = new ClipboardItem({ "text/html" : content });

        navigator.clipboard.write([content]).then(
            () => {
                this.notify("Your signature has been copied. You can now configure it on your email client")
            },
            () => {
                this.notify("Your signature couln't be copied. If the issue persistes, please contact your administrator")
            },
        );
        
    }
